import "./style.css";
import { NavLink, Link } from "react-router-dom";
import { useTokenContext } from "../../context/TokenContext";
import SearchForm from "../SearchForm/index.js";
const NavHead = () => {
  const { token, setToken, loggedUser } = useTokenContext();
  const { id } = loggedUser;
  return (
    <nav className="navbarHead">
      <ul className="navbarHead">
        {/* Si no hay token, pintamos los enlaces a registro y login */}
        {!token && (
          <>
            <li></li>
          </>
        )}
        {token && (
          <>
            <li>
              {" "}
              <img
                src={`http://localhost:4000/uploads/4fc78d18-e082-44d4-af82-6c33a3d6200c.jpg`}
                alt="Casigram Logo"
              />{" "}
            </li>
            <li>
              <button
                className="navicon"
                onClick={() => {
                  setToken("");
                }}
              >
                <ion-icon name="log-out-outline"></ion-icon>
              </button>
            </li>
          </>
        )}
      </ul>
    </nav>
  );
};
export default NavHead;
